description:
Collection of the new serenity comic series released by Dark Horse in conjunction with Joss Whedon. Ongoing series, this is the first three in the collection, will be uploading them as they are released and a compilation in the end.
Purchased these and thought others could enjoy them, even if they cannot afford to support the series. No changes to the format, no added tags or sponsor pages. Just pure browncoat goodness.

